#include <stdio.h>
#include <stdlib.h>

typedef struct Point {
    int x, y;
} Point;

int comparePoints(const void *a, const void *b) {
    Point *p1 = (Point *)a;
    Point *p2 = (Point *)b;
    if (p1->x != p2->x) return p1->x - p2->x;
    return p1->y - p2->y;
}

int main() {
    int n, m;
    while (scanf("%d %d", &n, &m) == 2) {
        Point *black = (Point *)malloc(n * sizeof(Point));
        Point *white = (Point *)malloc(m * sizeof(Point));
        for (int i = 0; i < n; i++) {
            scanf("%d %d", &black[i].x, &black[i].y);
        }
        for (int i = 0; i < m; i++) {
            scanf("%d %d", &white[i].x, &white[i].y);
        }
        qsort(black, n, sizeof(Point), comparePoints);
        qsort(white, m, sizeof(Point), comparePoints);

        int i = 0, j = 0;
        while (i < n && j < m) {
            if (black[i].x == white[j].x) {
                if (black[i].y < white[j].y) {
                    printf("NO\n");
                    goto next_dataset;
                }
                i++;
                j++;
            } else if (black[i].x < white[j].x) {
                i++;
            } else {
                j++;
            }
        }
        printf("YES\n");
next_dataset:
        free(black);
        free(white);
    }
    return 0;
}
